to the broken youth in search of healing: 

your healing lies waiting, somewhere in that future, and you must go in search of it. 

because that is the only way you'll find peace. you must live long enough to find it. 

and you will, find it, believe me.";}i:147;a:1:{s:14:"comments_count";i:1;}i:148;a:1:{s:11:"likes_count";i:0;}i:149;a:1:{s:4:"link";s:39:"https://www.instagram.com/p/CEuXXsHl64T";}i:150;a:1:{s:5:"image";s:248:"https://scontent-sin6-1.cdninstagram.com/v/t51.2885-15/e35/118807344_162279645439372_3915490186627237639_n.jpg?_nc_ht=scontent-sin6-1.cdninstagram.com&_nc_cat=104&_nc_ohc=jsN2t_mbdOgAX8IcF9s&_nc_tp=18&oh=df582a8ef1a3f88c8931171be65c4841&oe=5F7D00E5";}i:151;a:1:{s:4:"type";s:5:"image";}i:152;a:1:{s:8:"owner_id";i:13083624221;}i:153;a:1:{s:14:"owner_username";s:0:"";}i:154;a:1:{s:14:"owner_fullname";s:0:"";}i:155;a:1:{s:9:"owner_pic";s:0:"";}i:156;a:1:{s:2:"id";s:19:"2390951188177009758";}i:157;a:1:{s:10:"short_code";s:11:"CEuXXAWlrxe";}i:158;a:1:{s:12:"created_time";i:1599243614;}i:159;a:1:{s:7:"caption";s:365:"Believe in yourself.
