Author: Sara Ann O'Sullivan 

Hi guys! Happy Friday!! We are going to take a break from the Heart Collection for one moment. I wrote this poem today because it is one of those days I woke up a little later than normal with a negative mindset. I was going through my morning routine and everything just felt off. I sat down on my computer  and I told myself that it is fine to be negative but it is not fine to let the negativeness ruin your whole day. So I decided to focus on the good of the day! Hope you guys are all looking at the brighter side of things. 

